import React from 'react'

class AllVideos extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      videos: this.props.videos || []
    }
  }
  render(){
  let videoList = this.state.videos.map((video)=>{return <li key={video}>{video}</li>})
  return (<div>
    <h3>Insert your video</h3>
    <p>All your videos:</p>
    <ul>{videoList}</ul>
  </div>)
  }
}
export default AllVideos
